import React from "react";
import "./login.css";

export const AccountBox = () => {
  return (
    <div className="BoxContainer">
      <div className="TopContainer">
        <HeadText>Login</HeadText>
        <div className="HeaderContainer"></div>
        <div className="BackDrop"></div>
      </div>
    </div>
  );
};
